【商品説明】<br>
野菜やくだものの元肥や追肥に、ばらまくだけでしっかり効く、かんたん便利な肥料です。栄養分を効率よく吸収させるすぐれた腐植酸入り緩効性肥料として特許を取得しています(特許第4923502号)。温度変化にあわせて溶出量が調節される「リリースコントロールテクノロジー」採用で、植物の生育に合った栄養補給が可能です。<br>
<br>
【使用方法】<br>
・元肥として使用する場合：植物を植える前にあらかじめ土に施します。植え付け、植え替え、種まき時に適量を土に混ぜ込みます。※肥料が直接根に触れても肥料焼けしません。<br>
・追肥として使用する場合：植物を植えた後に生長に応じて、株元に均一にばらまきます。2-3ヵ月間隔で、株元に均一にばらまきます。<br>
<br>
【使用量の目安】<br>
●野菜（元肥・追肥）<br>
・トマト、ピーマン、イチゴ<br>
標準プランター(65cm)：60-70g(5-6g/用土L)<br>
菜園(花壇)：150-200g/平方メートル<br>
・果菜類(ナス、キュウリなど)<br>
標準プランター(65cm)：140g(12g/用土L)<br>
菜園(花壇)：350g/平方メートル<br>
・葉菜類<br>
